export function matchHasIdenticalModes(modesFromA, modesFromB) {
    if (modesFromA.length === 0 || modesFromB.length === 0)
        return false;
    if (modesFromA.length !== modesFromB.length)
        return false;
    return modesFromA.every(mode => modesFromB.includes(mode));
}
export function matchHasAllowedMode(targetMode, allowedModes) {
    return allowedModes.includes(targetMode);
}
